import {Component} from 'react'
import axios from 'axios'

class SmsList extends Component{
    state = {
        smsList:[],
        isFetched:false
    }
    
    async componentDidMount(){
                const {isFetched} = this.state;
                if(!isFetched){
                console.log("api called");
                const response = await axios.get("/api/students")
                .then(response =>{
                    console.log(response);
                    const data = response.data;
                    console.log(data);
                    this.setState({smsList:data});
                })
                .catch(error=>{
                    console.log("error",error);
                });
            }
        }
        

    render(){
        const {smsList} = this.state;
        return(
            <div className='sms-list-container'>
                <ul>
                    {smsList.map((eachItem)=>(
                        <div>
                        <li key={eachItem.studentName}>{eachItem.studentName}</li>
                        <li key={eachItem.studentAdress}>{eachItem.studentAdress}</li>
                        <li key={eachItem.studentEmail}>{eachItem.studentEmail}</li>
                        </div>
                    ))}
                </ul>
            </div>
        )
    }
}
export default SmsList
